import React from "react";

class MyApplications extends React.Component {
  constructor(props) {
    super(props);
    this._isMounted = false;
    this.state = {
      applications: [],
    };
  }
  componentDidMount() {
    this._isMounted = true;
    axios.defaults.withCredentials = true;
    axio;
  }
  componentWillUnmount() {
    this._isMounted = false;
  }
}

export default MyApplications;
